import React from 'react'
import {Redirect} from 'react-router-dom'
import Nav from './Nav'

const ColorIndex = ({colors}) => {
	const goToForm = () => (
		<Redirect to='/colors/new' />
	)
	
	return (
		<>
			<h1>Color Picker</h1>
			<button onClick={goToForm}>Pick A Color</button>
			<Nav colors={colors} />
		</>
	)
}

export default ColorIndex
